-- ----------------------------
-- View structure for distribution_houses_info
-- ----------------------------
DROP VIEW IF EXISTS `distribution_houses_info`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `distribution_houses_info` AS select `distribution_houses`.`id` AS `id`,`distribution_houses`.`point_name` AS `house_name`,`zones`.`zone_name` AS `zone_name`,`regions`.`region_name` AS `region_name`,`territories`.`territory_name` AS `territory_name` from (((`distribution_houses` left join `zones` on((`distribution_houses`.`zones_id` = `zones`.`id`))) left join `regions` on((`distribution_houses`.`regions_id` = `regions`.`id`))) left join `territories` on((`distribution_houses`.`territories_id` = `territories`.`id`)));

SET FOREIGN_KEY_CHECKS = 1;
